import React from 'react';
import { View , Text , Stylesheet } from 'react-native';

import { PinInput } from 'native-base';

function PinView( props ) {
    return(
        <View>
            <Text> Kunal PinView </Text>
            <PinInput inputSize="md" value="" variant="outline">
                <PinInput.Field />
                <PinInput.Field />
                <PinInput.Field />
                <PinInput.Field />
            </PinInput>
        </View>
    )
}
export default PinView;
